import React from 'react';

const About = () => {
  return (
    <div className='flex justify-content min-w-full  bg-red-100'>
      {/* <h1 className='items-center mx-auto justify-center my-4'>About</h1> */}
        <div className='container border mx-10'> 
          <h1 className='text-4xl text-white'>Judul</h1>
        </div>
        <div className='container mr-10 border'>
          <h1 className='text-white'>lorem ipsum </h1>
        </div>
    </div>
  )
}

export default About;
